    Jobs.sort(key=lambda x: -x[2])
    dp = [0] * max_d
    for job in Jobs:
        for j in range(min(max_d - 1, job[1] - 1), -1, -1):
            if dp[j] == 1:
                dp[j] = job[2]
                break
    jobs_done = 0
    max_p = 0
    for p in dp:
        if p > 0:
            jobs_done += 1
            max_p += p
    return (jobs_done, max_p)

